material-ui个性化样式
material-ui是一个类Material Design风格的ReactUI库，它可以快速构建响应式网站及手机App设计。为了让用户在不同的场景需求下，能自定义组件样式，material-ui提供了丰富的自定义工具。

设置全局默认样式
material-ui的组件样式通过style对象进行配置，style对象内默认包含了Material Design的样式配置，默认字体、配色和其他默认样式，所以可以在全局上设置默认样式。使用material-ui官方提供的"createMuiTheme"方法个性化全局默认样式。

```javascript
const theme = createMuiTheme({
  palette: {
    primary: blue
  },
  typography: {
    fontFamily: 'Heiti',
    fontSize: 14,
    h1: {
      fontFamily: 'Heiti',
      fontSize: '2rem',
      fontWeight: 300
    }
  },
  overrides: {
    MuiButtonBase: {
      root: {
        color: '#8a8a8a',
        '&$focusVisible': {
          backgroundColor: 'hotpink'
        }
      }
    }
  }
});

ReactDOM.render(
  <ThemeProvider theme={theme}>
    {/* Application With Shelved ChallengeUI */}
  </ThemeProvider>,
  document.getElementById('root')
);
```

一般组件个性化（override）
对于一般组件，除使用全局样式设置外，还可以直接使用material-ui组件的override属性来自定义样式。

```javascript
<TextField
  id="standard-basic"
  label="Standard"
  InputProps={{
    classes: {
      notchedOutline: classes.notchedOutline
    }
  }}
/>

