 Narrow the String Format In Java

String formats are commonly used in various Java applications to format and display variables, such as numbers and dates. In this article, we will discuss how to narrow the string format in the Java programming language.

Narrowing a string format means making the string more specific as we need. This is done by specifying certain arguments and controlling the width of the string output. For example, when displaying a number as a percentage, we can specify a range from 0.00% to 100.00% to more precisely format the number. We can also set the field width to define the number of printed characters for a specific data.

Java provides the Format class to narrow string outputs. In the example below, we can see how to narrow the string output for the percentage variable.

int per = 44;
String performatted = String.format("%.2f%%", (float) per / 100);
System.out.println(performatted); // 44.00%

The example above formatthe percentage to two decimal places and identify the char % as a string. The returned output is different if we do not format the string. The output would be just 0.00 for 45/55 without the specified limits in the format.

In conclusion, narrowing the string format allows us to make outputs explicitly more precise and readable.
